INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 102301, 24001, 401, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 102301, 24002, 402, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 102301, 24003, 403, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192201, 24004, 701, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192201, 24005, 702, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192201, 24006, 703, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192301, 24007, 801, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192301, 24008, 802, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192301, 24009, 803, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192501, 24010, 501, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 0.0, "やった！", "");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192501, 24011, 502, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 0.0, "勝ったよ！", "");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192501, 24012, 503, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 0.0, "いい調子！", "");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 113501, 24013, 111, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 6, 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 113501, 24014, 112, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 113501, 24015, 113, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192401, 24016, 611, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192401, 24017, 612, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 192401, 24018, 613, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 113401, 24019, 211, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 113401, 24020, 212, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 113401, 24021, 213, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 106501, 24022, 311, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 2, 106501, 24023, 312, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 106501, 24024, 313, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 6, 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 3, 102301, 24025, 421, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 4, 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192201, 24026, 721, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 3, 192301, 24027, 821, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, 0.0, 1, 192501, 24028, 521, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 0.0, "いい勝負だったよ\nまたやろうね", "");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, -360.0, 2, 113501, 24029, 101, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, -360.0, 2, 113501, 24030, 102, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, -360.0, 2, 113501, 24031, 103, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, -360.0, 1, 113501, 24032, 104, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 2, 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト");
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (10046, 24, -360.0, 2, 113501, 24033, 105, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 0.0, 1, 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト");
